import React, { Component } from 'react';
import "~react-vis/dist/style";
import {XYPlot, XAxis, YAxis, HorizontalGridLines, LineSeries} from 'react-vis';
 
class PieChart extends Component {
	render() {
		return (
			<XYPlot
				width={300}
				height={300}>
				<HorizontalGridLines />
				<LineSeries
					data={[
						{x: 1, y: 10},
						{x: 2, y: 5},
						{x: 3, y: 15}
					]}/>
				<XAxis />
				<YAxis />
			</XYPlot>
		);
	}
}

export default PieChart;
